import Reviews from "../components/Check-reviews/Reviews"
import Footer from "../components/Common/Footer"
import { Greyed } from "../components/Common/Greyed"

const CheckReviews = () => {
    return (
        <div>
            <Greyed />
            <Footer />
            <Reviews />
        </div>
    )
}

export default CheckReviews
